import { Link } from "react-router-dom";

import "./Movies.css";

interface MovieCardProps {
  id: number;
  title: string;
  overview: string;
  popularity: number;
}

export function MovieCard({ id, title, overview, popularity }: MovieCardProps) {
  return (
    <div className="Movies-card">
      <Link to={`/movies/${id}`}>{title}</Link>
      <div>{overview}</div>
      <div>{popularity}</div>
    </div>
  );
}
